import React from 'react';
import { Container, Box, Tabs, Tab } from '@material-ui/core';
import Apps from './Apps';
import Policy from './Policy';

export class Home extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      value: "Coderals",
      pageComponent: {}
    }
  }

  handleChange(event, newValue){
    if(newValue === "Apps")
      this.setState({pageComponent:(<Apps/>)});
    else {
      this.setState({pageComponent:(<Policy/>)});
    }
  }

  render() {
    return (
      <Box>
        <Box
        color="#b0bec5"
        bgcolor="#455a64"
        paddingTop="10%">
          <Tabs
          centered
          value={this.state.value}
          onChange={this.handleChange.bind(this)}>
            <Tab label="Coderals" value="Coderals"/>
            <Tab label="Apps" value="Apps"/>
            <Tab label="Privacy Policy" value="Policy"/>
          </Tabs>
        </Box>
        <Box
        color="#b0bec5"
        bgcolor="#90a4ae"
        paddingBottom="90%"
        >
          {this.state.pageComponent}
        </Box>
      </Box>
    );
  }
}
